INSERT INTO `ejercicios` VALUES (1,'Elevar y descender dron','Neurofeedback','El dron partirá del suelo y se elevará cuando se mantenga la concentración necesaria, pero descenderá lentamente cuando se pierda la concentración o se alcance la altura máxima.','Altura máxima: 2 m','Altura mínima: medio metro','EjerElevar.png'),(2,'Mover dron hacia adelante y hacia atrás','Neurofeedback','El dron avanzará hacia adelante cuando llegue al nivel de concentración esperado y se mantendrá flotando cuando se pierda la concentración una vez alcance la longitud máxima retrocederá.','Altura máxima: 2m','Altura mínima: 0.5m','EjerAdelante.png'),(3,'Mover dron hacia derecha y a la izquierda','Neurofeedback','El dron se moverá a la derecha cuando llegue al nivel de concentración esperado y se mantendrá flotando cuando se pierda la concentración una vez alcance la longitud máxima se moverá hacia la izquierda.','Altura de flotamiento por defecto: 1m','Rango de movimiento 1m','EjerIzquierda.png'),(4,'Aterrizar Dron','Neurofeedback','El dron buscará elevarse mientras se pierda la concentración, el objetivo es que el paciente logre concentrarse hasta que el dron aterrice.','Atura maxima 2m','El dron debe aterrizar','EjerDecender.png'),(5,'Vuelo de dron en circulo','Neurofeedback','El dron se moverá en círculo en dirección a las manecillas del reloj si se mantiene la concentración esperada, de lo contrario se mantendrá flotando.','Altura de flotamiento por defecto: 1 metros','Radio de flotamiento .5m','EjerCirculo.png'),(6,'Pirueta del dron','Neurofeedback','El dron hara una pirueta cuando se alacance 5 veces el umbral, la primera pirueta sera hacia adelante y la segunda hacia atras de manera ciclica','Altura de flotamiento por defecto: 1 metros','Rango maximo 1m','EjerPirueta.png'),(7,'1-Comando mental','Control Mental','El paciente podra selecionar un evento de dron ','Altura maxima 1m','Rango de movimiento 1m','EjerUnoCM.png'),(8,'2-Comandos mentales','Control Mental','El paciente podra selecionar dos eventos de dron','Altura maxima 1m','Rango de movimiento 1m','EjerDosCM.png'),(9,'3-Comandos mentales','Control Mental','El paciente podra selecionar tres eventos de dron','Altura maxima 1m','Rango de movimiento 1m','EjerTresCM.png'),(10,'4-Comandos mentales','Control Mental','El paciente podra selecionar cuatro eventos de dron','Altura maxima 1m','Rango de movimiento 1m','EjerCuatroCM.png'),(11,'Entorno Virtual 1','Neurofeedback',NULL,'entornovirtual','entornovirtual',NULL);
